# `goatscape`

.left-column[
- New effort
- What's in a name?
- Summarizes ancillary data for a user-defined landscape polygon
  - Census (via `censusapi`)
  - Landcover and Impervious (via `FedData`)
- Accepts arbitrary spatial data for the landscape
- Based on `sf`
- Tidy by design
]
